import web from '../src/images/web.png'
import app from '../src/images/application.png'
import android from '../src/images/android.png'
import digital from '../src/images/digital.png'
import marketing from '../src/images/marketing.png'
import software from '../src/images/software.png'

const Sdata = [
    {
        imgsrc: web,
        title: "Web Development",
    },
    {
        imgsrc: app,
        title: "Application Developer",
    },
    {
        imgsrc: android,
        title: "Android Developer",
    },
    {
        imgsrc: digital,
        title: "Digital",
    },
    {
        imgsrc: marketing,
        title: "Marketing",
    },
    {
        imgsrc: software,
        title: "Software Developer",
    },
]

export default Sdata
